const FETCH_POSTS = 'FETCH_POSTS';
const FETCH_POST_DETAILS= 'FETCH_POST_DETAILS';

export function posts ({posts}){
    return{
        type: FETCH_POSTS,
        posts,
    }
}

export function postDetails({id}){
    return{
        type: FETCH_POST_DETAILS,
        id,
    }
}
